import React from 'react';
import Header from './Header';
import Home from '../pages/Home/Home';
import { Route, Routes } from 'react-router-dom';

const DefaultLayout = () => {
    return (
        <>
            <Header/>
            <Routes>
                <Route path="" element={<Home/>}/>
            </Routes>
        </>
    );
}

export default DefaultLayout;
